int findEqual(int* arr, int n)
{
	for (int i = 1; i < n - 1; i++)
	{
		if (arr[i - 1] + arr[i + 1] == arr[i])
			return 1;
	}

	return 0;
}

function asd(input) {
  let badGradeLimit = Number(input[0]);
  let index = 1;
  let taskName = input[index];
  let taskGrade = Number(input[index + 1]);
  let badGradesCounter = 0;
  let avvCounter = 0;
  let gradeSum = 0;
  let lastProblem = "";

  while (taskName !== "Enough") {
    lastProblem = taskName;
    avvCounter++;
    gradeSum += taskGrade;
    if (taskGrade <= 4) {
      badGradesCounter++;
    }
    if (badGradesCounter === badGradeLimit) {
      console.log(`You need a break, ${badGradesCounter} poor grades.`);
      break;
    }
    index += 2;
    taskName = input[index];
    taskGrade = Number(input[index + 1]);
  }
  if (taskName === "Enough") {
    console.log(`Average score: ${(gradeSum / avvCounter).toFixed(2)}`);
    console.log(`Number of problems: ${avvCounter}`);
    console.log(`Last problem: ${lastProblem}`);
  }
}

#include <stdio.h>

void main()
{
	int array[] = { 1,3,5,6,11 };
	int array2[] = { 1,3,3,6,11 };
	int array3[] = { 1,3,2,5,11 };

	int exSorted, re;

	re = isSorted(array, (sizeof(array) / sizeof(int)), &exSorted);
	printf("[1] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

	re = isSorted(array2, (sizeof(array2) / sizeof(int)), &exSorted);
	printf("[2] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

	re = isSorted(array3, (sizeof(array3) / sizeof(int)), &exSorted);
	printf("[3] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

	printf("-----------------------------------\n");

	exSorted = 1;

	re = isSorted_rec(array, (sizeof(array) / sizeof(int)), &exSorted);
	printf("[1] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

	re = isSorted_rec(array2, (sizeof(array2) / sizeof(int)), &exSorted);
	printf("[2] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

	re = isSorted_rec(array3, (sizeof(array3) / sizeof(int)), &exSorted);
	printf("[3] array returned: %d || array ex sorted: %d\n\n", re, exSorted);

}

int isSorted(int* arr, int n, int *exSorted)
{
	int re;
	re = 0;

	*exSorted = 1;

	for (int i = 0; i < n - 1; i++)
	{
		if (arr[i] > arr[i + 1])
		{
			*exSorted = 0;

			return 0;
		}

		if (arr[i] == arr[i + 1])
			*exSorted = 0;
	}

	return 1;
}

int isSorted_rec(int* arr, int n, int* exSorted)
{
	if (n <= 1)
		return 1;

	int num, num2;

	num = arr[n - 1];
	num2 = arr[n - 2];

	if (num < num2)
	{
		*exSorted = 0;

		return 0;
	}

	if (num == num2)
		*exSorted = 0;

	return isSorted_rec(arr, n-1, exSorted);
}

