	printf("\n\n---START---\n");

	for (int i = 0; i < (sizeof(array)/sizeof(int)); i++)
		printf("%d, ", array[i]);

	printf("\nSizeof Array: %d\n", sizeof(array)/sizeof(int));
	printf("Max: %d\n", max);
	printf("Min: %d\n", min);
	printf("Sum: %d\n", sum);
	printf("Avg.: %.3lf\n", avg);
	printf("Even: %d\n\n", isEven);
}


void arrCalc(int* arr, int n, int* max, int* min, int* sum, double* avg, int* isEven)
{
	int tempLargest = arr[0], tempSmallest = arr[0];

	* max = * min = arr[0];

	*sum = 0;
	*isEven = 0;

	for (int i = 0; i < n; i++)
	{
		if (arr[i] > *max)
			*max = arr[i];

		if (arr[i] < *min)
			*min = arr[i];

		if (*isEven == 0 && arr[i] % 2 == 0)
			*isEven = 1;

		*sum += arr[i];
	}

	*avg = *sum / n;
}

