int main() {
    int a, b, c;
    cin >> a >> b >> c;
    
    int niza[3];
    niza[0] = a;
    niza[1] = b;
    niza[2] = c;
    sort(niza, niza + 3);
    a = niza[0];
    b = niza[1];
    c = niza[2];
    
    int max_a = a, max_b = b, max_c = c;
    if(a >= 5) {
        max_a = 5;
    }
    if(b >= 5) {
        max_b = 5;
    }
    if(c >= 5) {
        max_c = 5;
    }
    int sum = max_a + max_b + max_c;
    
    if(a + sum - max_a >= b - max_b or a + sum - max_a >= c - max_c or b + sum - max_b >= c - max_c) {
        cout << "DA" << endl;
    }
    else {
        cout << "NE" << endl;
    }
    return 0;
}

#include <iostream>
using namespace std;
 
int main() {
    int n;
    cin >> n;
    
    int res = 2e9;
    for(int i = 0; i <= n; i++) {
        int d = 5 * i;
        if(d >= n) {
            if(res > i) {
                res = i;
            }
            
        }
        
        if(d <= n) {
            
            
            int s = n - d;
            s /= 10;
            
            if((n - d) % 10 != 0) {
                s++;
            }
            if(i >= s) {
                if(res > i + s) {
                    res = i + s;
                }
            }
        }
        
    }
    cout << res << endl;
    return 0;
}

